import React, {Component} from "react";
import './button.css';
import {FormControl, FormGroup, } from "reactstrap"; 
export default class ButtonComponent extends Component {
    constructor(props) {
        super(props); 
    }
    render() {
        return (
            <div>
                <p><b> {this.props.question} </b></p>
                <div>
                    {
                        <form id="someForm" >
                        <input onChange={(event) => this.props.onChange(event.target.value)} name="ans" type="text" required />
                        </form>
                    }

               </div>
            </div>
    
        );
    }
}
